import React , {useState, useEffect} from 'react'

const ListBands2 = () => {
    const [bands, setBands] = useState([])

    useEffect(()=>{
        obtainData()
    },[])

    const obtainData = async () => {
        const data = await fetch('https://my-json-server.typicode.com/improvein/dev-challenge/db')
        const bands = await data.json()
        setBands(bands.name)
    }

    return(
        <div>
            <h1>Bands</h1>
            <ul>
                {
                    bands.map(item => (
                        <li key={bands.id}>{bands.name} - {bands.year}</li>
                    ))
                }
            </ul>
        </div>
    )
}

export default ListBands2;
